De familie Van End is een Nederlands gezin dat gedurende twee weken een Duitse uitwisselingsstudent over de vloer krijgt. Dit heeft een dusdanige impact op de verschillende familieleden dat hun hele leven op zijn kop wordt gezet. Dit leidt tot pijnlijke, ontroerende en hilarische situaties. Ze kunnen zich met de komst van deze in alle opzichten perfecte uitwisselingsstudent, niet meer voorstellen hoe ze ooit met hun imperfecte zelf hebben kunnen leven. dorpje.



